import React from "react";
import { useLocation } from "react-router";

const Profile = () => {
  let location = useLocation();
  const userData = location.state;

  // Check if userData is defined before accessing its properties
  if (!userData) {
    return <div>Loading...</div>;
  }

  return (
    <div className="card">
      <div className="card-body">
        <h5 className="card-title">Name: {userData?.name}</h5>
        <p className="card-text">
          Some quick example text to build on the card title and make up the
          bulk of the card's content.
        </p>
      </div>
      <ul className="list-group list-group-flush">
        <li className="list-group-item">Contact Number: {userData?.contact_number}</li>
        <li className="list-group-item">Higher Education: {userData?.higher_education_details}</li>
      </ul>
      <div className="card-body"></div>
    </div>
  );
};

export default Profile;
